import {api} from "@/helpers/axios"

export const resource = "wagon-park" 

const getWagons = () => {
    return api.get(`${resource}/wagons`)
}

const getWagonType = () => {
    return api.get(`${resource}/wagon-type`)
}

const getPass = () => {
    return api.get()
}

export default {
    getWagons,
    getWagonType
}
